	add("acanthocephalan", "{\"term\":\"acanthocephalan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἄκανθος\u0027 (thorn) + \u0027κεφαλή\u0027 (head)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of parasitic intestinal worms comprising the phylum Acanthocephala. \u0026lt;ref name\u003dSOED\u0026gt;Brown, Lesley, ed. \u0027The Shorter Oxford English Dictionary.\u0027 5th. Oxford: Oxford University Press, 2003.\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, D. W. T. Crompton, \u0027An Ecological Approach to \u0027\u0027Acanthocephalan\u0027\u0027 Physiology\u0027, [http://books.google.com.au/books?id\u003dxAg9AAAAIAAJ\u0026amp;pg\u003dPA25\u0026amp;dq\u003d%22more%7Cmost+acanthocephalan%22%7C%22acanthocephalans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003duEPBUub4F4OVkwXbm4EY\u0026amp;ved\u003d0CGsQ6AEwC\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22more%7Cmost%20acanthocephalan%22%7C%22acanthocephalans%22\u0026amp;f\u003dfalse page 25\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"That discussion of fish intestines is justified because many \u0027\u0027acanthocephalans\u0027\u0027 have been described from fish\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, B. B. Nickol, \u0027Phylum Acanthocephala\u0027, P. T. K. Woo (editor), \u0027Fish Diseases and Disorders\u0027, Volume 1: Protozoan and Metazoan Infections, 2nd Edition, [http://books.google.com.au/books?id\u003dbm7HSCLcCbUC\u0026amp;pg\u003dPA458\u0026amp;dq\u003d%22more%7Cmost+acanthocephalan%22%7C%22acanthocephalans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003duEPBUub4F4OVkwXbm4EY\u0026amp;ved\u003d0CD0Q6AEwA\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22more%7Cmost%20acanthocephalan%22%7C%22acanthocephalans%22\u0026amp;f\u003dfalse page 458\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Clearly \u0027\u0027acanthocephalans\u0027\u0027 contain large amounts of lipid and possess enzyme systems for lipid metabolism (Filipponi et al., 1994; Weber et al., 1995); however, use of these lipid deposits in energy metabolism is yet to be demonstrated\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Dennis J. Richardson, Brent B. Nickol, \u002715: Acanthocephala\u0027, Carter T. Atkinson, Nancy J. Thomas, D. Bruce Hunter (editors), \u0027Parasitic Diseases of Wild Birds\u0027, [http://books.google.com.au/books?id\u003dQUjl757YL6wC\u0026amp;pg\u003dPA277\u0026amp;dq\u003d%22more%7Cmost+acanthocephalan%22%7C%22acanthocephalans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003duEPBUub4F4OVkwXbm4EY\u0026amp;ved\u003d0CDgQ6AEwA\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22more%7Cmost%20acanthocephalan%22%7C%22acanthocephalans%22\u0026amp;f\u003dfalse page 277\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Acanthocephalans\u0027\u0027 are dioecious pseudocoelomate worms remarkably adapted to a parasitic lifestyle in that there is no mouth or digestive system\", \"priority\":10}]}, \"synonyms\":{}}");

